    name: vehicle?.name || '',
    type: vehicle?.type || 'Car',
    category: vehicle?.category || 'luxury',
    pricePerDay: vehicle?.pricePerDay || vehicle?.price || '',
    year: vehicle?.year || new Date().getFullYear(),
